import React from 'react';

const ListCard = (props) => {
  return (
    <div className="my-card">
      <h2>{props.title}</h2>
      <h2>
        <ul>
          {props.data.map(item => Object.values(item)).map(a => <li>{a[0]} ({a[1]})</li>)
         }
        </ul>
      </h2>
    </div>
  );
}

const StatCard = (props) => {
  return (
    <div className="my-card">
      <h2>{props.title}</h2>
      <h2>{props.type == "dollar" ? "$" : ""}{props.data}</h2>
    </div>
  );
}

export { StatCard, ListCard };
